import React from 'react'
import {About, Header, Footer, Skills, Work} from './container/index'

const App = () => {
  return (
   <div className='app'>
     <About />
     <Footer />
     <Header />
     <Skills />
     <Work />
   </div>
    
    
  );
}

export default App;
